import React from "react";
import "./Header.css";
import houseicon from "../../images/houseicon.png";

const ExpenseDate = () => {
  const month = 32;

  return (
    <div className="header">
      <img src={houseicon} alt="House Icon" />
      <h2>House Expense Tracker</h2>
      <h5>House Expense Tracker</h5>
    </div>
  );
};

export default ExpenseDate;
